import React, { Component } from "react";
import Questions from './Questions'
import Procedure from './Procedure'
import "./App.css";

class App extends Component {
  render() {
    return (
      <div class="d-md-flex h-md-100 align-items-center">
        <div class="col-md-6 p-0 h-md-100">
          <div class="d-md-flex align-items-center h-100 p-5 text-center justify-content-center">
              <div class="logoarea pt-5 pb-5">
                  First half content here
              </div>
          </div>
        </div>


      <div class="col-md-6 p-0 h-md-100 loginarea">
          <div class="d-md-flex align-items-center h-md-100 p-5 justify-content-center">
              Second half content here
          </div>
      </div>

</div>
    );
  }
}

export default App;
